export function Login(){

    return (
        <div>
            <h2>Login </h2>
            <hr />
        </div>
    );
}

export function Register(){
    return (
        <div >
            <h2>Register New User</h2>
            <hr />
        </div>
    );
}

export function EffectsComponent() {
    return (
        <div className="container-fluid mt-3">
            <button>Login</button>
            <button>Register</button>
            <hr />
        </div>
    );
}
